import React, { Fragment } from "react";
import { Form, Input, Layout, Typography, Row, Col, Button } from "antd";
import MenuFooter from "../custom/footer";

const layout = {
  labelCol: {
    span: 8
  },
  wrapperCol: {
    span: 5
  }
};
const RememberPassword = () => {
  return (
    <Fragment>
      <Layout>
        <Layout.Content style={{ margin: "5em 16px" }}>
          <div
            style={{
              background: "#fff",
              padding: 44,
              minHeight: 380
            }}
            className="border border-danger"
          >
            <Form hideRequiredMark {...layout}>
              <Row></Row>
              <Row>
                <Col>
                  <Form.Item
                    name="email"
                    label="Email"
                    rules={[
                      { required: true, type: "email", message: "Enter email" }
                    ]}
                  >
                    <Input />
                  </Form.Item>
                </Col>
                <Col>
                  <Form.Item
                    name="email"
                    label="Email"
                    rules={[
                      { required: true, type: "email", message: "Enter email" }
                    ]}
                  >
                    <Button></Button>
                  </Form.Item>
                </Col>
              </Row>
            </Form>
          </div>
        </Layout.Content>
      </Layout>
      <MenuFooter />
    </Fragment>
  );
};

export default RememberPassword;
